import {FaArrowLeft} from 'react-icons/fa';

const ButtonWithIcon = ({type, onClick}) => {

    const getIcon = (type) => {
        if (type=="back"){
            return FaArrowLeft;
        }
    }

    return (
        <button className="button" onClick={() => onClick()}>
            {getIcon()}
        </button>
    )
}

export default ButtonWithIcon;
